import React from 'react';
import '../styles/ForgotPassword.css'; // Import the CSS file

function ForgotPassword() {
  return (
    <div className="forgot-password-page">
      <div className="forgot-password-container">
        <h1>Car Park</h1>
        <div className="forgot-password-form">
          <input type="text" placeholder="Phone number" className="forgot-password-input-field" />
          <button className="reset-password-button">Reset Password</button>
          <p className="login-text">Remember your password? <a href="/login">Login</a></p>
        </div>
      </div>
    </div>
  );
}

export default ForgotPassword;
